export const SHOW_NEW_COMPONENT = "SHOW_NEW_COMPONENT";

export const setComponentName = (componentName, isUserComponent) => ({
    type: SHOW_NEW_COMPONENT,
    payload: {componentName: componentName,
        isUserComponent: isUserComponent}
});
